import React, { Component } from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import 'tachyons'
import Particles from 'react-particles-js';
import Clarifai from 'clarifai'



const app = new Clarifai.App({
  apiKey: 'ea9878001bea4b2b86fdc1406ee8926b'
});


const particlesOptions = {
  particles: {
    line_linked: {
      shadow: {
        enable: true,
        color: '#3CA9D1',
        blur:5
      }
    }
  }
}

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: ','
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value)
  }

  onButtonSubmit = () => {
    console.log('click');
    app.models.predict("ea9878001bea4b2b86fdc1406ee8926b", "https://www.muscleandfitness.com/wp-content/uploads/2015/08/what_makes_a_man_more_manly_main0.jpg?w=940&h=529&crop=1&quality=86&strip=all").then(
      function(response) {
        console.log(response);
      },
      function(eer) {

      }
    );
  };

  render() {
    return(
      <div className="App">
        <Particles className='particles'
          params={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
        {
          // <FaceRecognition />
        }
      </div>
    )
  }
}

export default App;
